import { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(){
    super();

    this.state = {
      Adegbesan: [
      {name: 'Seyi'},
      {name: 'Chinenye'},
      {name: 'Tobechukwu'},
      {name: 'Chinonso'},
      {name: 'Olileanyachi'}
    ]}
  }
  render(){
    return (
      <div className="App">
         {this.state.Adegbesan.map( (Adegbesan) => {
            return <h1>{Adegbesan.name}</h1>
         })}
      </div>
    );
  }
}

export default App;
